import React from 'react';
import { CSSTransition, TransitionGroup } from 'react-transition-group';

import './with-transition.styles.scss';

const WithTransition = ({ children, ...otherProps })  => (
	<TransitionGroup className='page'>
		<CSSTransition
			{ ...otherProps }
			timeout='600'
            classNames="fade"
        >
            {children}
        </CSSTransition>
	</TransitionGroup>
)

export default WithTransition;
